const instance = axios.create({
    baseURL: 'https://localhost:3000/users',
    timeout: 1000,
    headers: { 'Authorization': 'token' }
});

export const loadUserSuccess = (data) => ({
    type: 'LOAD_USER',
    data
})

export const loadUser = () => ({
    type: 'LOAD_USER'
})

export const addUser = (name, phone) => ({
    type: 'ADD_USER',
    name,
    phone
})
